
CREATE DATABASE IF NOT EXISTS gravelocwebappdb;
USE gravelocwebappdb;
CREATE TABLE IF NOT EXISTS Users (
    username VARCHAR(30) NOT NULL UNIQUE,
    password VARCHAR(64) NOT NULL,
    PRIMARY KEY(username)
);

