CREATE TABLE IF NOT EXISTS BlockImages (
    blockImageFilename VARCHAR(50) NOT NULL UNIQUE,
    blockID INT NOT NULL,
    blockImageID VARCHAR(50) NOT NULL UNIQUE,

    PRIMARY KEY(blockImageID)
);


CREATE TABLE IF NOT EXISTS Searches (
    searchID VARCHAR(32) NOT NULL UNIQUE,
    name VARCHAR(300) NOT NULL,
    blockChosen INT NOT NULL,
    lot INT,
    plot INT,
    blockImageFilename VARCHAR(60),
    HLImageFilename VARCHAR(120),
    PRIMARY KEY(searchID)
);


CREATE TABLE IF NOT EXISTS Surveys (
    surveyID VARCHAR(32) NOT NULL UNIQUE,
    searchID VARCHAR(32) NOT NULL UNIQUE,
    surveyResponseOne INT NOT NULL,
    surveyResponseTwo VARCHAR(200) NOT NULL,
    surveyResponseThree VARCHAR(200) NOT NULL,
    PRIMARY KEY(surveyID)
);
CREATE TABLE IF NOT EXISTS Blocks (
    blockID INT NOT NULL,
    NW_LAT DECIMAL(12, 8) NOT NULL,
    NW_LONG  DECIMAL(12, 8) NOT NULL,
    SE_LAT  DECIMAL(12, 8) NOT NULL,
    SE_LONG  DECIMAL(12, 8) NOT NULL,
    CENTER_LAT  DECIMAL(12, 8) NOT NULL,
    CENTER_LONG  DECIMAL(12, 8) NOT NULL,
    PRIMARY KEY(blockID)
);


